import React from 'react';
import { Navbar, Nav, NavDropdown, Container } from 'react-bootstrap';

function CustomNavbar() {
  return (
    <Navbar expand="lg" bg="light" variant="light">
      <Container>
        <Navbar.Brand href="#home">QUEST |Nawabshah</Navbar.Brand>
        <Navbar.Toggle aria-controls="basic-navbar-nav" />
        <Navbar.Collapse id="basic-navbar-nav">
          <Nav className="me-auto">
            <Nav.Link href="#home">Home</Nav.Link>
            <NavDropdown title="Academics" id="basic-nav-dropdown">
              {/* Dropdown items */}
            </NavDropdown>
            <NavDropdown title="Faculties" id="basic-nav-dropdown">
              {/* Dropdown items */}
            </NavDropdown>
            <NavDropdown title="Research" id="basic-nav-dropdown">
              {/* Dropdown items */}
            </NavDropdown>
            <NavDropdown title="Admisions" id="basic-nav-dropdown">
              {/* Dropdown items */}
            </NavDropdown>
            <NavDropdown title="Facilities" id="basic-nav-dropdown">
              {/* Dropdown items */}
            </NavDropdown>
            <NavDropdown title="Stundets Life" id="basic-nav-dropdown">
              {/* Dropdown items */}
            </NavDropdown>
            <NavDropdown title="News and Events" id="basic-nav-dropdown">
              {/* Dropdown items */}
            </NavDropdown>
            <NavDropdown title="About" id="basic-nav-dropdown">
              {/* Dropdown items */}
            </NavDropdown>
            {/* More NavDropdowns for other items */}
          </Nav>
        </Navbar.Collapse>
      </Container>
    </Navbar>
  );
}

export default CustomNavbar;
